  baseURL: API_URL,
  headers: {
    'Content-Type': 'application/json',
  },
});

export const login = async (cpf, senha) => {
  try {
    const response = await api.post('/logar', { cpf, senha });
    return response.data;
  } catch (error) {
    throw error;
  }
};

